import Layout from './../components/Layout';


const Login = () => {
    return(
        <Layout>
            <div className="container">
                <LoginBox />
                <style jsx>
                    {`

                        .container {
                            width: 100%;
                            height: 100%;
                            
                        }
                    
                    `}
                </style>
            </div>
            
        </Layout>
       
    )
}

export default Login;
